drop database if exists `E-Commerce`;
create database if not exists `E-Commerce` char set utf8 collate utf8_general_ci;
use `E-Commerce`;

CREATE TABLE `users` (
    `User_ID` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `User_Name` VARCHAR(100) NOT NULL,
    `User_Email` VARCHAR(100) NOT NULL UNIQUE,
    `User_Password` VARCHAR(100)  NULL,
    `User_Password_Hash` VARCHAR(100)  NULL,
    `User_Token` VARCHAR(100) NULL,
    `GroupID` BOOLEAN DEFAULT 0
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `payments` (
  `id` int(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `payment_id` varchar(255) NOT NULL UNIQUE,
  `Payment_User_Id` INT(11) NOT NULL,
  `payer_id` varchar(255) NOT NULL,
  `payer_email` varchar(255) NOT NULL,
  `payer_first_name` VARCHAR(225) NOT NULL,
  `payer_last_name` VARCHAR(225) NOT NULL,
  `payer_shipping_address` TEXT NOT NULL,
  `payee_email` VARCHAR(225) NOT NULL,
  `amount` float(10,2) NOT NULL,
  `currency` varchar(255) NOT NULL,
      FOREIGN KEY (`Payment_User_Id`)
        REFERENCES `users` (`User_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


CREATE TABLE `categories` (
    `Cateory_ID` INT(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `Category_Name` VARCHAR(100) NOT NULL,
    `Category_Desc` TEXT DEFAULT NULL,
    `Parent_Category` INT NULL DEFAULT NULL,
    FOREIGN KEY (`Parent_Category`)
        REFERENCES `categories` (`Cateory_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `brands` (
    `Brand_ID` INT(11) NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `Brand_Name` VARCHAR(100) NOT NULL,
    `Brand_Desc` TEXT NOT NULL
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `products` (
    `Product_ID` INT PRIMARY KEY AUTO_INCREMENT,
    `Product_Name` VARCHAR(100) NOT NULL,
    `Product_Desc` TEXT,
    `Product_Purchase_Price` INT NOT NULL,
    `Product_Sale_Price` INT NOT NULL,
    `Product_Tax_Percent` INT NULL,
    `Product_discount_Percent` INT NULL,
    `Product_Images` TEXT NULL DEFAULT 'a:1:{i:0;s:11:"default.png";}',
    `Product_Overview` TEXT NOT NULL,
    `Product_Attributes` TEXT NOT NULL,
    `Product_Brand_id` INT NOT NULL,
    `Product_Shipping_Price` INT NOT NULL,
    FOREIGN KEY (`Product_Brand_id`)
        REFERENCES `brands` (`Brand_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `product_category` (
    `Product` INT NOT NULL,
    `Category` INT NOT NULL,
    
    # PRIMARY KEY (`Product` , `Category`),
    
    FOREIGN KEY (`Product`)
        REFERENCES `products` (`Product_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (`Category`)
        REFERENCES `categories` (`Cateory_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;


CREATE TABLE `options_groups` (
    `Option_Group_ID` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `Option_Group_Name` VARCHAR(15) NOT NULL
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `options` (
    `Option_ID` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `Option_Name` VARCHAR(50) NOT NULL,
    `Option_Option_Grouo_id` INT NOT NULL,
    FOREIGN KEY (`Option_Option_Grouo_id`)
        REFERENCES `options_groups` (`Option_Group_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `product_option` (
    `Option` INT NOT NULL,
    `Product` INT NOT NULL,
    #PRIMARY KEY (`Option` , `Product`),-- 
    FOREIGN KEY (`option`)
        REFERENCES `options` (`Option_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (`product`)
        REFERENCES `products` (`Product_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `orders` (

    `Order_ID` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
    `Order_Date` DATETIME NOT NULL DEFAULT NOW(),
    `Order_User_id` INT NOT NULL,
    `Order_First_Name` VARCHAR(100) NOT NULL,
    `Order_Last_Name` VARCHAR(100) NOT NULL,
    `Order_User_Country` VARCHAR(100) NOT NULL,
    `Order_User_City` VARCHAR(100) NOT NULL,
    `Order_User_Zip` VARCHAR(100) NOT NULL,
    `Order_User_Adress` TEXT NOT NULL,
    `Order_User_Adress2` TEXT NOT NULL,
    `Order_User_Phone` VARCHAR(20) NOT NULL,
    `Order_User_Email` VARCHAR(100) NOT NULL,
    `Order_Tax_Percent` INT NULL,
    `Order_discount_Percent` INT NULL,
    `Order_Total` INT NULL,
    `Order_Status`  ENUM('processed.','Complete','Reactionary','') DEFAULT 'processed.',
    FOREIGN KEY (`Order_User_id`)
        REFERENCES `users` (`User_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;

CREATE TABLE `items_order` (
    `Item` INT NOT NULL,
    `Order` INT NOT NULL,
    `Item_Name` VARCHAR(100) NOT NULL,
    `Item_Sale_Price` INT NOT NULL,
    `Item_Tax_Percent` INT NULL,
    `Item_discount_Percent` INT NULL,
    `Item_Shipping_Price` INT NOT NULL,
    `Quantity` INT NOT NULL ,
    PRIMARY KEY (`Item` , `Order`),
    FOREIGN KEY (`Item`)
        REFERENCES `products` (`Product_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (`Order`)
        REFERENCES `orders` (`Order_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;


CREATE TABLE `cart` (
    `Cart_ID` INT NOT NULL UNIQUE KEY AUTO_INCREMENT,
    `Cart_Date` DATETIME NOT NULL DEFAULT NOW(),
    `Item` INT NOT NULL,
    `Quantity` INT NOT NULL DEFAULT 1,
    `User` INT NOT NULL,
    PRIMARY KEY (`Item` , `User`),
    FOREIGN KEY (`User`)
        REFERENCES `users` (`User_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (`Item`)
        REFERENCES `products` (`Product_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;


CREATE TABLE `product_Wish` (
	`Wish_ID` INT UNIQUE AUTO_INCREMENT,
    `User` INT NOT NULL,
    `Product` INT NOT NULL,
    PRIMARY KEY (`User` , `Product`),
    FOREIGN KEY (`User`)
        REFERENCES `users` (`User_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE,
    FOREIGN KEY (`product`)
        REFERENCES `products` (`Product_ID`)
        ON DELETE CASCADE ON UPDATE CASCADE
)  ENGINE=INNODB CHARSET=UTF8;

